const Play =  () => {
    const mean = useSelector(state => state.mean)

    const renderedwords = mean.map(mean => (
            <>
              <h3>{mean.means}</h3>
              <h2>{mean.word}</h2>
            </>
    ))

    return (
        {renderedwords}
    )
}

export default Save
